webpackJsonp([0x9eee254ab88e],{"./node_modules/json-loader/index.js!./.cache/json/en-blog-git-10-tips-to-start-using-github-and-cmd.json":function(e,t){e.exports={data:{markdownRemark:{fileAbsolutePath:"/home/angeloocana/dev/angeloocana/src/pages/blog/git/10-tips-to-start-using-github-and-cmd.en.md",html:'<p>Do NOT lose your files anymore! Keep track of the history change, save to the cloud and be safe.\nHere you are going to learn simple tips to become a <strong>NINJA</strong> using <strong>Github</strong> and the <strong>command line</strong>.</p>\n<h3>1. Go to <a href="https://github.com">github.com</a>.</h3>\n<p>  <strong>Sign In</strong> or <strong>Sign Up</strong>.</p>\n<h3>2. Click the button <strong>Start a project</strong> in the home page.</h3>\n<ul>\n<li>Choose a Repository Name, the URL for your project will be\ngithub.com/USER-NAME/REPOSITORY-NAME</li>\n<li>Click the button <strong>Create repository</strong></li>\n</ul>\n<p>  Congratulations! Your repository is ready to receive the files that you will never lose anymore.</p>\n<h3>3. Install Git (If you don’t have it).</h3>\n<ul>\n<li>Arch linux: <code>pacman -S git</code></li>\n<li>Windows: Download and install <a href="https://git-for-windows.github.io/">https://git-for-windows.github.io/</a></li>\n<li>Mac: Go to App Store and Install <strong>XCode</strong></li>\n</ul>\n<h3>4. Go to your folder and add files</h3>\n<p>Open the terminal or command line tool available on your system.</p>\n<p>Type the commands bellow to go to the folder where you want your files to live in:</p>\n<ul>\n<li><code>ls</code> or <code>dir</code> list the files and directories.</li>\n<li><code>cd FOLDER_NAME</code> open the folder.</li>\n<li><code>cd ..</code> go up 1 folder level.</li>\n</ul>\n<p>Clone the repository to your PC:</p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    <span class="token function">git</span> clone https://github.com/YOUR_USER_NAME/REPOSITORY_NAME\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    <span class="token function">cd</span> REPOSITORY_NAME\n</code></pre>\n      </div>\n<p>uhuhuh Now Save or Add any file you want to the folder.</p>\n<h3>5. See the changes:</h3>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    <span class="token function">git</span> status\n</code></pre>\n      </div>\n<h3>6. Add the changes to commit:</h3>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    <span class="token function">git</span> add <span class="token keyword">.</span>\n</code></pre>\n      </div>\n<p>  Don’t forget the dot <strong>.</strong></p>\n<h3>7. Create the commit</h3>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    <span class="token function">git</span> commit -m <span class="token string">\'What did I... \'</span>\n</code></pre>\n      </div>\n<p>  Write a short message saying what you have changed, Try to keep a good history log.</p>\n<h3>8. Publish! Save your files and changes to the cloud.</h3>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    <span class="token function">git</span> push\n</code></pre>\n      </div>\n<h3>9. Keep your local version update:</h3>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    <span class="token function">git</span> pull\n</code></pre>\n      </div>\n<h3>10. Go sleep better knowing that your files are safe.</h3>\n<p>Want to learn more advanced stuff? <a href="https://angeloocana.com/en/blog/git/git-setup/">Click here to become a NINJA</a>.</p>',excerpt:"Do NOT lose your files anymore! Keep track of the history change, save to the cloud and be safe.\nHere you are going to learn simple tips to...",fields:{tagSlugs:[{tag:"Git",link:"/en/tags/git/"},{tag:"version control",link:"/en/tags/version-control/"}],slug:"/en/blog/git/10-tips-to-start-using-github-and-cmd/",readNextPosts:[{excerpt:"Is your Android mobile FULL? Backup your data to your Arch Linux.\nIt is easy following my steps (I hope hahaha).\nI had some trouble with...",frontmatter:{title:"Access and Backup Android Files and Photos",date:"2017-08-28"},fields:{slug:"/en/blog/linux/arch/backup-android-files/",langKey:"en"}},{excerpt:"",frontmatter:{title:"Functional Programming Examples",date:"2017-06-23"},fields:{slug:"/en/blog/functional-programming/examples/",langKey:"en"}},{excerpt:"Install git Install Nodejs Install NPM Fix global permissions error https://docs.npmjs.com/getting-started/fixing-npm-permissions Make a...",frontmatter:{title:"Setup dev env Arch linux",date:"2017-07-30"},fields:{slug:"/en/blog/linux/arch/setup-nodejs-env/",langKey:"en"}}]},frontmatter:{youtubeId:null,title:"10 tips to Start using Github and Command line",tags:["Git","version control"],date:"2017-09-21",structuredData:{alternativeHeadline:"...",type:"TechArticle",dependencies:"A computer",proficiencyLevel:"Beginner",articleSection:"Git",pageEnd:"...",pageStart:"...",pagination:"...",about:{name:"Git",alternateName:"Github",description:"Git is a free and open source distributed version control system designed to handle everything from small to very large projects with speed and efficiency.",identifier:"git",image:"...",sameAs:"https://git-scm.com/"},accessMode:"textual",accessModeSufficient:"textual",accessibilityAPI:"ARIA",accessibilityControl:"fullKeyboardControl, fullTouchControl, fullMouseControl",accessibilitySummary:"...",aggregateRating:"...",audience:"...",author:"angeloocana",comment:"...",commentCount:"...",contentLocation:"...",dateCreated:"...",dateModified:"...",datePublished:"...",discussionUrl:"...",educationalUse:"...",isAccessibleForFree:!0,isFamilyFriendly:!0,keywords:"...",locationCreated:"Ottawa CA",thumbnailUrl:"...",version:1,video:"..."}}}},pathContext:{path:"/en/blog/git/10-tips-to-start-using-github-and-cmd/",langKey:"en"}}}});
